import persona from '/src/assets/persona.svg';

const menuList = [
  {
    index: '1',
    title: 'Profils & Technologies',
    imageUrl: { persona },
    imageAlt: 'Profils & Technologies',
  },
  {
    index: '2',
    title: 'Expériences Professionnelles',
    imageUrl: '../assets/case.svg',
    imageAlt: 'Expériences Professionnelles',
  },
  {
    index: '3',
    title: 'Projets',
    imageUrl: '../assets/notebook.svg',
    imageAlt: 'Projets',
  },
  {
    index: '4',
    title: 'Formations',
    imageUrl: '../assets/study.svg',
    imageAlt: 'Formations',
  },
  {
    index: '5',
    title: 'Compétences',
    imageUrl: '../assets/skill.svg',
    imageAlt: 'Compétences',
  },
  {
    index: '6',
    title: 'Contacts',
    imageUrl: '../assets/message.svg',
    imageAlt: 'Contacts',
  },
];

export default menuList;
